Description:
Combination tool representing a Wilcox or similar type subsoiler with stalk chopper; tmg 082407.  Based on;
Subsoiler, rev 101606 DTL and
Rolling Stalk Chopper, ground driven with double rotor gangs covering the full width of the machine to close crevices behind ripper shanks.  This record represents operation on unridged ground where the weight of the machine is distributed across 100% of the working width. 110906 DTL
